import React from 'react';
import './CardInfo.css';

const CardInfo = () => {
    return (
        <>
            <div className='page_container'>
                <form className='cardInfo_form'>
                <label className='cardHolderNameLabel'>
                        CARDHOLDER NAME:
                        <input name='cardHolderName' type='text' placeholder='e.g. Jane Appleseed' autoComplete='name' required/>
                    </label>
                    <label className='cardHolderNumberLabel'>
                        CARDHOLDER NUMBER:
                        <input name='cardHolderNumber' type='text' placeholder='e.g. 1234 5678 9123 0000' autoComplete='name' required/>
                    </label>
                    <label className='cardHolderNumberLabel'>
                        EXP. DATE (MM/YY):
                        <input name='cardHolderExpMonth' type='text' placeholder='e.g. 1234 5678 9123 0000' autoComplete='name' required/>
                        <input name='cardHolderExpMonth' type='text' placeholder='e.g. 1234 5678 9123 0000' autoComplete='name' required/>
                    </label>
                </form>
            </div>
        </>
    );
}

export default CardInfo;
